import React from 'react';
import ReactDOM from 'react-dom';

const SearchPanel = () => { return <input type="search"></input> };

const App = () => {
    return (
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    );
};

ReactDOM.render(<App />, document.getElementById('root'));
